root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<HOME />} />
      <Route path="/post/:postName" element={<Singlepost />} />
      <Route path="/tag/:TagName" element={<Tag />} />
      <Route path="/group/:groupName" element={<Category />} />
      <Route path="/subtag/:SubtagName" element={<Subgroup />} />
    </Routes>
  </BrowserRouter>
);

